import { BrowserRouter, Router, Switch } from "react-router-dom";
import Login from "./component/Login";
import Register from "./component/Register";

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Router exact path="/">
          <Login/>
        </Router>
        <Router path="/Register">
          <Register/>
        </Router>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
